  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115605 includes Surface
  underway, chemical, meteorological and physical data collected from METEOR in the
  English Channel, Indian Ocean, North Atlantic Ocean and North Sea from 1994-10-12
  to 1994-11-12 and retrieved during cruise 06MT19941012. These data include BAROMETRIC
  PRESSURE, Partial pressure (or fugacity) of carbon dioxide - atmosphere, Partial
  pressure (or fugacity) of carbon dioxide - water, SALINITY, SEA SURFACE TEMPERATURE
  and WATER TEMPERATURE. The instruments used to collect these data include Carbon
  dioxide (CO2) gas analyzer and Shower head chamber equilibrator for autonomous carbon
  dioxide (CO2) measurement. These data were collected by Arne Koertzinger of Universitat
  Kiel; Institut Fur Meereskunde; Forschungsbereich Marine Biogeochemie as part of
  the Meteor30/2(A02)_underway data data set.nnThe Global Volunteer Observing Ship
  (VOS) Program is coordinated by the UNESCO International Ocean Carbon Coordination
  Project (IOCCP). International groups from 14 countries have been outfitting research
  ships and commercial vessels with automated CO2 sampling equipment to analyze the
  carbon exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
